import { Button } from "@material-ui/core";
import { Autocomplete, TextField } from "@mui/material";
import { DataGrid } from "@mui/x-data-grid";
import React, { useEffect, useState } from "react";
import CustomPagination from "../../../components/CustomPagination";
import CustomNoRowsOverlay from "../../../components/customRowComponent";
import { CommonController } from "../../../_redux/controller/common.controller";

export const TCSAccount = ({accountType}) => {
  const [companyList, setCompanyList] = useState([]);
  const [browseListData, setBrowseListData] = useState([]);
  const [totalRecord, setTotalRecords] = useState(0);
  const [loading, setLoading] = useState(false);
  const [params, setParams] = useState({
    pageNo: 1,
    pageSize: 15,
    filter_value: "",
    sort_column: "",
    sort_order: "",
  });
  const handlePageSizeChange = (param) => {
    setParams({ ...params, pageSize: param });
  };
  const handlePageChange = (param) => {
    setParams({ ...params, pageNo: param });
  };
  const getBrowseListData = async () => {
    setLoading(true);
    await CommonController.commonApiCall(
      "master/browse_account_master_tcs",
      params,
      {account_type:accountType},
      "node"
    )
      .then((data) => {
        if (data.status === 200) {
          setBrowseListData(data.data);
          setTotalRecords(data.totalRecords);
        }
      })
      .catch((err) => {
        showErrorToast(err);
      });
    setLoading(false);
  };
  useEffect(() => {
    CommonController.commonApiCallFilter("Dropdown/GetCompanyList").then(
      (data) => {

      }
    );
  }, []);
  let columns = [
    {
      field: "id",
      headerName: "ID",
      width: 300,
      hide: false,
    },
    {
      field: "comp_name",
      headerName: "Company Name",
      width: 500,
      hide: false,
    },
    {
      field: "regiongh",
      headerName: "TCS Per",
      width: 400,
      hide: false,
    },
    {
      field: "region",
      headerName: "Action",
      width: 180,
      hide: false,
    },
  ]
  return (
    <div className="py-3">
     <div className="row">
      <div className="col-md-3">
        <Autocomplete
          size="small"
          // options={groupList}
          getOptionLabel={(option) => option.value}
          fullWidth
          // value={{ id: formData?.group_id, value: formData?.group_name }}
          // onChange={(event, value) =>
          //   handleAutoChange("group_id", "group_name", value)
          // }
          variant="outlined"
          renderInput={(params) => (
            <TextField {...params} label="Group" variant="outlined" />
          )}
        />
      </div>
      <div className="col-md-3 mb-5">
            <TextField
              label="Company Id"
              fullWidth
              // disabled
              variant="outlined"
              size="small"
              name="company_id"
              // value={formData.company_id}
              // onChange={handleChange}
            />
          </div>
          <div className="col-md-3 mb-5">
          <Button
          variant="contained"
          // onClick={saveForm}
          color="primary"
          disableElevation
        >
          Submit
        </Button>
          </div>

    </div>
    <div style={{ height: 500, width: "100%" }}
      >
        <DataGrid
          pagination
          disableColumnFilter
          pageSize={params.pageSize}
          page={params.pageNo}
          // getRowClassName={(params)=>params.row.srno%2?"odd" :"even"}
          rowsPerPageOptions={[15, 25, 50, 100]}
          rowCount={totalRecord}
          paginationMode="server"
          onPageSizeChange={handlePageSizeChange}
          onPageChange={handlePageChange}
          loading={loading}
          rowHeight={30}
          components={{
            Pagination: CustomPagination,
            NoRowsOverlay: CustomNoRowsOverlay,
          }}
          onSortModelChange={(sort) => {
            if (sort.length > 0) {
              setParams({
                ...params,
                sort_column: sort[0].field,
                sort_order: sort[0].sort,
              });
            }
          }}
          // onColumnVisibilityChange={(e) => handleColumnHide(e)}
          columns={columns}
          rows={browseListData} //accountMasterList
        />
      </div>
    </div>

  );
};
